import React, { Component } from 'react';
import LogoPC from './images/LogoPC.svg';
import { Link } from 'react-router-dom';
import { Layout, Navigation, Content } from 'react-mdl';
import Posti from './images/Posti.jpg';
import HackathonGOC from './images/HackathonGOC.jpg';
import CodeWeek from './images/CodeWeek.jpg';
import Adidas from './images/Adidas.jpg';
import BetsFriends from './images/BetsFriends.jpg';
import Vredestein from './images/Vredestein.jpg';
import PCdesign from './images/PC-Design.jpg';
import PCtechnical from './images/PC-Technical.jpg';

import "fullpage.js/vendors/scrolloverflow"; // Optional. When using scrollOverflow:true
import ReactFullpage from "@fullpage/react-fullpage";

class Landing extends Component {
  render() {
    return(
      <ReactFullpage
        fitToSection = {true}
        sectionsColor = {["white", "purple", "green"]}
        scrollOverflow = {true}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section section fp-auto-height">
                <div>
                <img src={LogoPC} style={{height: '20em'}}/>
                <h1>UX / UI Designer</h1>
                <p>"Design it till you make it"</p>
                <Link to="/PC-folio.github.io/projects"
                  style= {{fontWeight: 'bold', fontSize: '1.5em', color: 'black'}}>
                  projects</Link>
                </div>
              </div>
              <div className="section">
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/vredestein"><img className="ProjectPic" src={Vredestein}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/posti"><img className="ProjectPic" src={Posti}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/betsFriends"><img className="ProjectPic" src={BetsFriends}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/hackathonAD"><img className="ProjectPic" src={Adidas}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/hackathonGOC"><img className="ProjectPic" src={HackathonGOC}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/hackathonWK"><img className="ProjectPic" src={CodeWeek}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/pcdesign"><img className="ProjectPic" src={PCdesign}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/pctechnical"><img className="ProjectPic" src={PCtechnical}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/vredestein"><img className="ProjectPic" src={Vredestein}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/posti"><img className="ProjectPic" src={Posti}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/betsFriends"><img className="ProjectPic" src={BetsFriends}/></Link>
              </Navigation>
              <Navigation style={{display: 'inline'}}>
                  <Link to="/PC-folio.github.io/hackathonAD"><img className="ProjectPic" src={Adidas}/></Link>
              </Navigation>
                </div>
              <div className="section fp-auto-height">
                <h3>Section 3</h3>
                <button onClick={() => fullpageApi.moveTo(2, 0)}>
                  Move top
                </button>
              </div>
            </div>
          );
        }}
      />
    );
  }
}

export default Landing;
